    [],nt"num_tags": 3,nt"name": "radiation-abating-highly-flexible-multifunctional-polyimide-cryogenic-and-thermal-insulati",nt"isopen":
    true,nt"url": null,nt"notes": "The development of highly flexible thermal
    insulation materials with multifunctional properties based in polyimide polymers
    and designed to provide significant radiation abatement is proposed. These new material
    forms provide their enhanced properties while ensuring benign behavior in adverse
    thermal environments ranging from cryogenic to elevated temperatures. In addition,
    the introduction of radiation abating materials into the polymeric precursor or
    foam provides a protective element not available in current state-of-the-art insulation
    materials.  The proposal team provides a fundamental understanding of the chemistry
    and physics of polyimide foams, the test facilities for measurement of structural
    and mechanical properties and production facilities sufficient to produce materials
    in volume necessary for prototype tests in NASA applications. ",nt"owner_org":
